        public NaacConsolidatProcessDTO onload(NaacConsolidatProcessDTO data)
        {
            try
            {
                NAAC_CommonDetails naaccomm = new NAAC_CommonDetails(_context);
                List<long> catigeroyid = new List<long>();

                var getinstitution = _context.Institution.Where(a => a.MI_Id == data.MI_Id).ToList();
                string NAACSL_InstitutionTypeFlg = "";
                if (getinstitution.Count() > 0)
                {
                    NAACSL_InstitutionTypeFlg = getinstitution.FirstOrDefault().MI_NAAC_InstitutionTypeFlg.ToUpper();

                    if (NAACSL_InstitutionTypeFlg == "DEEMED")
                    {
                        NAACSL_InstitutionTypeFlg = getinstitution.FirstOrDefault().MI_NAAC_SubInstitutionTypeFlg.ToUpper();
                    }
                }

                data.getinstitutioncycle = naaccomm.get_cycle_list(data.MI_Id, data.userid);

                var getcatigeroyid = (from a in _context.NAAC_User_PrivilegeDMO
                                      from b in _context.NAAC_User_Privilege_SLDMO
                                      where (a.NAACUPRI_Id == b.NAACUPRI_Id && a.IVRMUL_Id == data.userid && a.NAACUPRI_ActiveFlag == true
                                      && b.NAACUPRISL_ActiveFlag == true)
                                      select new NaacConsolidatProcessDTO
                                      {
                                          NAACSL_Id = b.NAACSL_Id

                                      }).Distinct().ToList();

                foreach (var c in getcatigeroyid)
                {
                    catigeroyid.Add(c.NAACSL_Id);
                }

                data.getparentidzero = _context.NaacDocumentUploadDMO.Where(a => a.NAACSL_ActiveFlag == true && a.NAACSL_ParentId == 0
                && a.NAACSL_InstitutionTypeFlg.ToUpper() == NAACSL_InstitutionTypeFlg && catigeroyid.Contains(a.NAACSL_Id)).OrderBy(a => a.NAACSL_SLNoOrder).ToArray();

                data.getalldata = _context.NaacDocumentUploadDMO.Where(a => a.NAACSL_ActiveFlag == true
                && a.NAACSL_InstitutionTypeFlg.ToUpper() == NAACSL_InstitutionTypeFlg && catigeroyid.Contains(a.NAACSL_Id)).OrderBy(a => a.NAACSL_SLNoOrder).ToArray();

                data.getinstitutionlist = naaccomm.get_Institution_User_list(data.MI_Id, data.userid);

                data.approvalflag = false;
                var getapprovalflag = _context.NAAC_User_PrivilegeDMO.Where(a => a.IVRMUL_Id == data.userid && a.NAACUPRI_ActiveFlag == true).ToList();
                data.approvalflag = getapprovalflag.FirstOrDefault().NAACUPRI_FinalFlg;
                data.approvalflagnew = getapprovalflag.FirstOrDefault().NAACUPRI_ApproverFlg;

            }
            catch (Exception ex)
            {
                Console.WriteLine(ex.Message);
            }
            return data;
        }
        public NaacConsolidatProcessDTO search(NaacConsolidatProcessDTO data)
        {
            try
            {
                var getinstitution = _context.Institution.Where(a => a.MI_Id == data.MI_Id).ToList();

                string NAACSL_InstitutionTypeFlg = "";

                if (getinstitution.Count() > 0)
                {
                    NAACSL_InstitutionTypeFlg = getinstitution.FirstOrDefault().MI_NAAC_InstitutionTypeFlg;
                }

                List<long> miid = new List<long>();

                var getmiid = (from a in _context.NAAC_User_PrivilegeDMO
                               from b in _context.NAAC_User_Privilege_InstitutionDMO
                               where (a.NAACUPRI_Id == b.NAACUPRI_Id && a.IVRMUL_Id == data.userid && a.NAACUPRI_ActiveFlag == true && b.NAACUPRIIN_ActiveFlag == true)
                               select new NaacConsolidatProcessDTO
                               {
                                   MI_Id = b.MI_Id

                               }).Distinct().ToList();

                foreach (var c in getmiid)
                {
                    miid.Add(c.MI_Id);
                }

                List<long> catigeroyid = new List<long>();

                var getcatigeroyid = (from a in _context.NAAC_User_PrivilegeDMO
                                      from b in _context.NAAC_User_Privilege_SLDMO
                                      where (a.NAACUPRI_Id == b.NAACUPRI_Id && a.IVRMUL_Id == data.userid && a.NAACUPRI_ActiveFlag == true
                                      && b.NAACUPRISL_ActiveFlag == true)
                                      select new NaacConsolidatProcessDTO
                                      {
                                          NAACSL_Id = b.NAACSL_Id

                                      }).Distinct().ToList();

                foreach (var c in getcatigeroyid)
                {
                    catigeroyid.Add(c.NAACSL_Id);
                }

                data.getparentidzero = _context.NaacDocumentUploadDMO.Where(a => a.NAACSL_ActiveFlag == true && a.NAACSL_ParentId == 0
                && a.NAACSL_InstitutionTypeFlg == NAACSL_InstitutionTypeFlg && catigeroyid.Contains(a.NAACSL_Id)).OrderBy(a => a.NAACSL_SLNoOrder).ToArray();

                data.getalldata = _context.NaacDocumentUploadDMO.Where(a => a.NAACSL_ActiveFlag == true
                && a.NAACSL_InstitutionTypeFlg == NAACSL_InstitutionTypeFlg).OrderBy(a => a.NAACSL_SLNoOrder).ToArray();


            }
            catch (Exception ex)
            {
                Console.WriteLine(ex.Message);
            }
            return data;
        }
