        public NaacConsolidatProcessDTO onclickapproval(NaacConsolidatProcessDTO data)
        {
            try
            {
                var checkdataexists = _context.NAAC_Criteria_ApprovalDMO.Where(a => a.MI_Id == data.temp_mi_id_list[0].MI_Id && a.NAC_CycleId == data.cycleid
                 && a.NAACSL_SLNo == data.NAACSL_SLNo).ToList();

                if (checkdataexists.Count > 0)
                {
                    var result = _context.NAAC_Criteria_ApprovalDMO.Single(a => a.MI_Id == data.temp_mi_id_list[0].MI_Id && a.NAC_CycleId == data.cycleid
                    && a.NAACSL_SLNo == data.NAACSL_SLNo);
                    result.NAC_Flag = "Approved";
                    result.NAC_UserId = data.userid;
                    result.NAC_UpdateDate = DateTime.Now;
                    _context.Update(result);
                    var i = _context.SaveChanges();
                    if (i > 0)
                    {
                        data.approvalmessage = "Criteria Approved";
                    }
                    else
                    {
                        data.approvalmessage = "Failed To Approved";
                    }
                }
                else
                {
                    NAAC_Criteria_ApprovalDMO dmo = new NAAC_Criteria_ApprovalDMO();
                    dmo.MI_Id = data.temp_mi_id_list[0].MI_Id;
                    dmo.NAACSL_SLNo = data.NAACSL_SLNo;
                    dmo.NAC_CycleId = data.cycleid;
                    dmo.NAC_Flag = "Approved";
                    dmo.NAC_UserId = data.userid;
                    dmo.NAC_CreatedDate = DateTime.Now;
                    dmo.NAC_UpdateDate = DateTime.Now;
                    _context.Add(dmo);
                    var i = _context.SaveChanges();
                    if (i > 0)
                    {
                        data.approvalmessage = "Criteria Approved";
                    }
                    else
                    {
                        data.approvalmessage = "Failed To Approved";
                    }
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine(ex.Message);
            }
            return data;
        }

